import React, { useState } from "react";
import './index.css';

let count=0;

const App = () =>
{
    const state = useState();
   // console.log(state);
    const [count,setcont] = useState(0);
    const hey = () => {
        setcont(count++);
        //console.log("Clicked "+ count++);

     }
    return(<>
    <div className="items">
    <h1 className="item">{count}</h1>
    <button className="item" onClick={hey}>Click Here</button>
    </div>
    </>);
};

export default App;
